import React, { Component } from "react";

export default function Starfield() {
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "/stars.js";
    script.async = true;
    document.body.appendChild(script);
  }, []);

  return (
    <div class="starfield">
      <canvas id="starField"></canvas>
    </div>
  );
}
